import React, { useState } from 'react';
import './styles/Home.css';
import './styles/Mobile.css';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

function Identifiants() {
    const [pseudo, setPseudo] = useState("");
    const [phraseRegister, setPhraseRegister] = useState("");
    const [newPassword, setNewPassword] = useState("");
    const [newConfirmPassword, setNewConfirmPassword] = useState("");
    const [errorMessage, setErrorMessage] = useState("");
    const [successMessage, setSuccessMessage] = useState(""); // Nouvel √©tat pour le message de succ√®s
    const [showPassword,setShowPassword]=useState(false)
    const [showConfirmPassword,setShowConfirmPassword]=useState(false)
    const navigate = useNavigate();

    const handleSubmit = async (e) => {
        e.preventDefault();
        const userData = {
            pseudo,
            phraseRegister,
            newPassword,
            newConfirmPassword
        };
        if (newPassword !== newConfirmPassword) {
            setErrorMessage("Les mots de passe ne sont pas identiques.");
            return;
        }
        try {
            const API_URL = window.location.hostname === 'localhost'
                ? "http://localhost:4000"
                : "https://myday-back.onrender.com";

            const response = await fetch(`${API_URL}/IdentifiantsMdp`, {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(userData),
                credentials: 'include'
            });

            const data = await response.json(); // Attendre la r√©ponse avant de la manipuler

            if (data.message) {
                setErrorMessage(data.message); // Afficher l'erreur
            } else {
                setErrorMessage(""); // 
                // setPseudo("");
                setPhraseRegister("");
                setNewPassword("");
                // Ici, tu peux g√©rer le succ√®s
                setSuccessMessage("Mot de passe r√©initialis√© avec succ√®s !");
                // R√©aliser la redirection vers la page de connexion apr√®s un d√©lai
                setTimeout(() => {
                    navigate('/Login');
                }, 2000); // Redirige apr√®s 2 secondes
            }
        } catch (error) {
            console.error("Erreur lors de l'envoi :", error);
            setErrorMessage("Erreur lors de la demande, veuillez r√©essayer.");
        }
    };

    return (
        <div className="container">
            <div className="header">
                <h1>
                    <span>m</span><span>y</span><span>D</span><span>a</span><span>y</span>
                </h1>
            </div>

            <h5>Identifiants</h5>
            <form onSubmit={handleSubmit}>
                <h4>
                    <label htmlFor="pseudo">Pseudo: </label>
                    <input
                        className="login-input"
                        type="text"
                        id="pseudo"
                        name="pseudo"
                        value={pseudo}
                        onChange={(e) => setPseudo(e.target.value)}
                        required
                    />
                </h4>
                <h4>
                    <select
                        id="phraseRegister"
                        className="phrase-select"
                        value={phraseRegister}
                        onChange={(e) => setPhraseRegister(e.target.value)}
                    >
                        <option>Choisir une phrase.</option>
                        <option value="pizza">Je suis l'√©lement principal de la pizza.</option>
                        <option value="ia">Mon cerveau est la meilleure de IA.</option>
                        <option value="courant">Je pr√©f√®re marcher √† contre-courant.</option>
                        <option value="toi">Toi sans moi, √ßa ne sera jamais nous.</option>
                    </select>
                </h4>
                <h4>
                    <label htmlFor="newPassword">Nouveau mot de passe: </label>
                    <input
                        className="login-input"
                        type={showPassword ? "text" : "password"}
                        id="newPassword"
                        name="newPassword"
                        value={newPassword}
                        onChange={(e) => setNewPassword(e.target.value)}
                        required
                        
                    />
                    <button 
                    
                    type="button" 
                    onClick={() => setShowPassword(!showPassword)}
                    className="button-option"
                >
                    {showPassword ? "üòé" : "üëÄ"}
                </button>
                </h4>
                <h4>
                    <label htmlFor="newConfirmPassword">Confirmation nouveau mot de passe: </label>
                    <input
                        className="login-input"
                        type={showConfirmPassword ? "text" :"password"}
                        id="newConfirmPassword"
                        name="newConfirmPassword"
                        value={newConfirmPassword}
                        onChange={(e) => setNewConfirmPassword(e.target.value)}
                        required
                    />
                    <button 
                    
                    type="button" 
                    onClick={() => setShowConfirmPassword(!showConfirmPassword)}
                    className="button-option"
                >
                    {showConfirmPassword ? "üòé" : "üëÄ"}
                </button>
                </h4>
                {errorMessage && <p className="error-message">{errorMessage}</p>}
                <div className="boutton-clear-submit-index">
                    <button type="submit" className="submit-button">
                        R√©initialiser le mot de passe 
                    </button>
                </div>
                <hr className="hr" />
            </form>

            {/* Affichage du message de succ√®s en pop-up */}
            {successMessage && (
                <div className="popup-success">
                    <p>{successMessage}</p>
                </div>
            )}

            <Link to="/Login">
                <button type="button" className="submit-button">
                    Connexion
                </button>
            </Link>

            <p className ="droits">¬© 2025 myDay. Tous droits r√©serv√©s.
            Cette application, ainsi que l‚Äôensemble de son contenu, est prot√©g√©e par les lois en vigueur relatives √† la propri√©t√© intellectuelle. Les donn√©es qu‚Äôelle contient sont chiffr√©es afin d‚Äôen garantir la s√©curit√©. </p>  
        </div>
    );
}

export default Identifiants;
